import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import ListLocationComponent from "./ListLocationComponent.jsx/ListLocationComponent";
import CreateLocationComponent from "./ListLocationComponent.jsx/CreateLocationComponent";

function App() {
  return (
    <div>
      <Router>
        <div className="container">
          <Switch>
            <Route path="/" exact component={ListLocationComponent}></Route>
            <Route path="/location" component={ListLocationComponent}></Route>
            <Route path="/add-location" component={CreateLocationComponent}></Route>
          <ListLocationComponent />
          </Switch>
        </div>{" "}
      </Router>{" "}
    </div>
  );
}

export default App;
